                   </div>

                   <div class="px-2 py-6 mx-auto lg:w-1/4 md:w-full">
                                               <div class="p-4 border rounded-xl">
                       <h3 class="mb-3 text-lg font-bold text-blue-700 lg:text-4xl title-font code"> WEBSITE(STATIC)
                       </h3>
                       <div class="flex flex-col items-center justify-center px-2 text-center lg:h-32">
                           <h2
                               class="flex items-center justify-center mt-2 mb-4 text-3xl font-bold leading-none text-blue-800 lg:text-6xl">
                                ₹ 1999+
                           </h2>
                       </div>
                       <button
                           class="flex items-center px-4 py-2 mx-auto mt-auto font-semibold text-black duration-500 ease-in-out transform code  rounded-lg shadow-xl transittion hover:text-white hover:bg-black hover:border-black focus:shadow-outline focus:outline-none">
                           Book
                       </button>
                       </div>
                   </div>

                   <div class="px-2 py-6 mx-auto lg:w-1/4 md:w-full">
                                               <div class="p-4 border rounded-xl">
                       <h3 class="mb-3 text-lg font-bold text-blue-700 lg:text-4xl title-font code"> WEBSITE(STATIC)
                       </h3>
                       <div class="flex flex-col items-center justify-center px-2 text-center lg:h-32">
                           <h2
                               class="flex items-center justify-center mt-2 mb-4 text-3xl font-bold leading-none text-blue-800 lg:text-6xl">
                                ₹ 1999+
                           </h2>
                       </div>
                       <button
                           class="flex items-center px-4 py-2 mx-auto mt-auto font-semibold text-black duration-500 ease-in-out transform code  rounded-lg shadow-xl transittion hover:text-white hover:bg-black hover:border-black focus:shadow-outline focus:outline-none">
                           Book
                       </button>
                       </div>
                   </div>

                   <div class="px-2 py-6 mx-auto lg:w-1/4 md:w-full">
                                               <div class="p-4 border rounded-xl">
                       <h3 class="mb-3 text-lg font-bold text-blue-700 lg:text-4xl title-font code">WEBSITE(DYNAMIC):
                       </h3>
                       <div class="flex flex-col items-center justify-center px-2 text-center lg:h-32">
                           <h2
                               class="flex items-center justify-center mt-2 mb-4 text-3xl font-bold leading-none text-blue-800 lg:text-6xl">
                                 ₹ 4499+
                           </h2>
                       </div>
                       <button
                           class="flex items-center px-4 py-2 mx-auto mt-auto font-semibold text-black duration-500 ease-in-out transform code  rounded-lg shadow-xl transittion hover:text-white hover:bg-black hover:border-black focus:shadow-outline focus:outline-none">
                           Book
                       </button>
                       </div>
                   </div>
               </div>
           </div>
       </section>


    </div>
